  switch(type) {
    case ACTIONS.ADD_DIGITS:
      if(state.overwrite)
      return{
        ...state,
        currentOpernad: payload.digit,
        overwrite: false,
      }
      if(payload.digit === "0" && state.currentOpernad === "0") return state
